            echo "<h1>Bom dia!</h1>";
            echo "<img src='https://i.ytimg.com/vi/Tk6e2nLxTqQ/hqdefault.jpg'>";
        }else if ($hora > 12 && $hora < 18){
            echo "<h1>Boa tarde!</h1>";
            echo "<img src='data:image/jpeg;base64,'>";
        }else if ($hora >= 18 && $hora <= 24){
            echo "<h1>Boa noite!</h1>";
            echo "<img src='data:image/jpeg;base64,'>";
        }
